import React, { useState, Component } from 'react';
import logo from './logo.svg';
import './App.css';
import List from "./components/List";
import AddToList from './components/AddToList';

export interface IState {
    toys: {
        classType: string
        name: string
        size: string
        producerId : number
        numberOfWheels? : number
        url: string
        note?: string
    }[]
}

function App() {

    const [toys, setToys] = useState<IState["toys"]>([
        {
            classType: "Car",
            name: "Ford GT40",
            size: "XL",
            producerId: 1,
            numberOfWheels: 4,
            url: "data:image/jpeg;base64,",
            note: "Ziemlich nice",
        },
        {
            classType: "Starship",
            name: "X-Wing",
            size: "S",
            producerId: 1,
            url: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSjvPEyUsvNaS2v4b-enzSghJrShtTIoeOOXw&usqp=CAU",
            note: "Bauen Julien und Holger gerne in Lego",
        },
        {
            classType: "Schach",
            name: "Queen",
            size: "XXL",
            producerId: 1,
            url: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSjvPEyUsvNaS2v4b-enzSghJrShtTIoeOOXw&usqp=CAU",
            note: "Bauen Julien und Holger gerne in Lego",
        }
    ])

  return (
      <div className="App">
        <h1>.:EOS:. Toy Store</h1>
          <h2>Toys in the inventory</h2>
        <List toys={toys}/>
        <AddToList setToys={setToys} toys={toys}/>
      </div>
  );
}

export default App;
